package com.example.appointment_module.domain;import jakarta.persistence.*;import java.sql.Timestamp;import lombok.Getter;import lombok.Setter;@Entity@Getter@Setterpublic class Appointment {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private Long idPatient;    private Long idDoctor;    private Timestamp timestamp;    private AppointmentType type;    public Appointment() {    }    public Appointment(Long idPatient, Long idDoctor, Timestamp timestamp, AppointmentType type) {        this.idPatient = idPatient;        this.idDoctor = idDoctor;        this.timestamp = timestamp;        this.type = type;    }}